    CHECK_INPUT(codebook);
    TORCH_CHECK(codebook.dim() == 1);
    TORCH_CHECK(codebook.scalar_type() == torch::kFloat16);

    size_t m = out.size(1);
    size_t n = out.size(0);
    size_t k = x.size(1);

    TORCH_CHECK(m == M);
    //TORCH_CHECK(n == N);
    TORCH_CHECK(k == K);
    TORCH_CHECK(compressed1.numel() * 64 == R1 * m * k / 2);
    TORCH_CHECK(compressed2.numel() * 64 == R2 * m * k / 2);
    TORCH_CHECK(x.size(0) == n);
